import React, {ChangeEvent} from 'react';

type InputType = {
    onChange: (event: ChangeEvent<HTMLInputElement>) => void
    value:number
}



const onChangeHandler = () => {
    onChange()
}

export const Input = (props:InputType) => {
    return (
        <div>
            <input type={"number"} onChange={onChangeHandler} value={props.value}/>
        </div>
    );
};
